import React from 'react';

const Navigation = ({ onRouteChange, isSignedIn }) =>{
        if (isSignedIn) {
            return (
            <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
            <p onClick={() => onRouteChange('SignIn')} className='f3 link dim black underline pa3 pointer bg-white'>Sign Out</p>
        </nav>);
        }
        else{
            return (
            <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
            <p onClick={() => onRouteChange('SignIn')} className='f3 link dim black underline pa3 pointer bg-white'>Sign In</p>
            <p onClick={() => onRouteChange('SignIn')} className='f3 link dim black underline pa3 pointer bg-white'>Register</p>
        </nav>);
        }
}

export default Navigation;
